import axios from 'axios';

const imageURL = "https://www.metaweather.com/static/img/weather/png/64/";

const getWeatherList = (zip) => {
    return  axios("/api/location/"+zip+"/", {
        method: 'GET',
      });
}

export default getWeatherList;
